import React from "react";

const PlayerSection = (scores) => {
  return (
    <table>
        <thead>
          <tr>Player</tr>
          <tr>Scores</tr>
        </thead>
        <tbody>
            {students.slice(1, students.length).map((item, index) => {
                return (
                <tr>
                    <td>{item[0]}</td>
                    <td>{item[1]}</td>
                    <td>{item[2]}</td>
                </tr>
                );
            })}
        </tbody>
    </table>
  );
};
export default PlayerSection;
